import React, { Component } from 'react';
import {Container, Col, Form,FormGroup, label, input, Button,} from 'react-bootstrap';

class Login extends Component {
    constructor(props){
        super(props);
        this.state = {
            email : "",
            password: ""
        }
    }
    render() {
    
      return(   
        <Container>
              <h2>Sing in</h2>
              <Form className="form">
          <Col>
            <FormGroup>
              <label>Email</label>
              <input
                type="email"
                name="email"
                id="exampleEmail"
                placeholder="myemail@email.com"
              />
            </FormGroup>
          </Col>
          <Col>
            <FormGroup>
              <Label for="examplePassword">Password</Label>
              <Input
                type="password"
                name="password"
                id="examplePassword"
                placeholder="********"
              />
            </FormGroup>
          </Col>
          <Button>Submit</Button>
          </Form>
        </Container>
      );
    }
  }

  export default Login;
